import './App.css';
import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Router>
            <Switch>
              <Route exact path="/">
              </Route>
              <Route path="/users">
              </Route>
              <Route path="/">
              </Route>
            </Switch>
        </Router>
      </header>
    </div>
  );
}

export default App;
